import "./App.css";
import Country from "./components/CountryData/Country";

function App() {
  return (
    <div className="row">
      <div className="col-9">.col-9</div>
      <div className="col-4">
        .col-4
        <br />
        Since 9 + 4 = 13 &gt; 12, this 4-column-wide div gets wrapped onto a new
        line as one contiguous unit.
      </div>
      <div className="col-6">
        .col-6
        <br />
        Subsequent columns continue along the new line.
      </div>
    </div>
  );
}

export default App;
